        <meta charset="utf-8">                    
        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-601575616":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"plus\",\"color\":\"#981d99\",\"hotspots\":[{\"position\":{\"x\":37.92906178489702,\"y\":5.1043650272506405},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Relancez ici une toute nouvelle recherche.</p><p>Il vous est possible aussi de lancer une recherche dans les différentes <em>entities</em>, les briques d'OpenAlex. Outre les <em>Works</em> ou travaux, vous pouvez rechercher :</p><ul><li>les auteur.ices ;</li><li>les sources (revues, ouvrages et répertoires) ;</li><li>les organismes financeurs (<em>funders</em>) ;</li><li>les institutions (universités, organismes de recherche).</li></ul>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Sans titre Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7169231e-6f3d-4f5e-83dc-0dff256a05d4\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"alt\":\"Liste des entities d'OpenAlex : les travaux ; les auteur.ices ;  les sources (revues, ouvrages et répertoires) ;  les organismes financeurs (funders) ;  les institutions (universités, organismes de recherche)\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Sans titre Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"eae2c5b9-0e12-4cf7-9936-a61159c036eb\"}],\"header\":\"Zone 1\"},{\"position\":{\"x\":41.13272311212815,\"y\":19.40428212620658},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Le rappel de la requête envoyée ainsi que la possibilité en cliquant sur le <strong>+ </strong>en bas à gauche<strong> </strong>de la modifier, de l'enrichir en ajoutant de très nombreux filtres, notamment les <em>entities</em>, mais aussi d'autres types de données.</p><p>Vous avez la possibilité, par ce biais de préciser l'angle de votre recherche documentaire en ajoutant par exemple un champ <em>Fields </em>et un  champ <em>Keywords</em> pour vous rapprocher au maximum de l'orientation de votre recherche documentaire.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Sans titre Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"33f5c547-b07e-466e-993e-f3d0329238a1\"}],\"header\":\"Zone 2\"},{\"position\":{\"x\":23,\"y\":63.075456134908784},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>La zone des résultats proprement dits. Le contenu de cette zone est dépendant du type d'<em>entities</em> que vous recherchez. Sur l'exemple nous avons des <em>Works </em>donc des travaux de recherche, mais nous pourrions avoir des <em>Authors </em>ou des <em>Institutions </em>par exemple.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Sans titre Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c8fe86ca-3635-49d8-b8ae-3bbcd4444eed\"}],\"header\":\"Zone 3\"},{\"position\":{\"x\":71.39999999999999,\"y\":56.28983249203351},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>La zone dite des <em>Stats </em>fournit des informations précieuses et variées, notamment sur la proportion de travaux en accès libres, la proportion d'articles, de chapitres, de bases de données, etc.</p><p>Il est possible de personnaliser votre set de statistiques </p><ul><li>en cliquant sur le <strong>+ </strong>en haut à droit de la zone pour en ajouter (mention spéciale pour les <em>keyword </em>et les <em>fields </em>ou domaines de recherche) ;</li><li>en cliquant sur la croix en haut à droite de chaque type de d'information pour la retirer de l'affichage.</li></ul><p>Attention, la zone des <em>Stats </em>n'est pas à proprement parler une zone de filtres à la manière des facettes. Nous vous recommandons, pour filtrer vos résultats, de le faire à partir de la <strong>Zone 2</strong>.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Sans titre Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"459fe97c-a4bb-4bef-826c-7d128df63829\"}],\"header\":\"Zone 4\"}],\"hotspotNumberLabel\":\"Puce #num\",\"closeButtonLabel\":\"Fermer\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"backgroundImageAltText\":\"Pas de résultats d'OpenAlex pour la recherche \\\"heritage label\\\"\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB8sAAARNCAYAAADVZqFmAAAAAXNSR0IArs4c6QAAIABJREFUeF7s3QecVPW99/HP9NmZ3dky23fZQm9SLUhRjCIoCiooYsGCKWpMYnJv2s1NzL25JU9i8kR9jInRxNiwIRYUsQOKggXpfXuvs9P78zpTltllVxZc3GX5HV8Jy86Zc87/fc7MsvM9v99fhSwiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIicJoJqE6z8cpwRUAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAERAAJy+UiEAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEROO0EJCw/7U65DFgEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREDCcrkGREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAEREAETjsBCctPu1MuAxYBERABERABERABERABERABERABERABERABERABERABERABERABERABEZCwXK4BERABERABERABERABERABERABERABERABERABERABERABERABERABERCB005AwvLT7pTLgEVABERABERABERABERABERABERABERABERABERABERABERABERABERABCQsl2tABERABERABERABERABERABERABERABERABERABERABERABERABERABETgtBOQsPy0O+UyYBEQAREQAREQAREQAREQAREQAREQAREQAREQAREQAREQAREQAREQAREQgeMOy4uKiq4GJgidCIiACIiACIiACIiACIiACIiACIiACIiACIiACIiACIiACIiACIiACIiACByPgEajebqsrGzf8TznZK17XGH5sGHD3lWpVHNP1sHIdkVABERABERABERABERABERABERABERABERABERABERABERABERABERABIa8wEOVlZW3D/Qo+xyWFxYWzlWr1e8O9AHL/kVABERABERABERABERABERABERABERABERABERABERABERABERABERABE5pAY/P5yuqr69vGshR9DksLyoqugf41UAerOxbBERABERABERABERABERABERABERABERABERABERABERABERABERABETg1BcIhUIXVFdXvzeQI5GwfCD1Zd8iIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAIiIAI
